  true,\n\t\"url\": null,\n\t\"notes\": \"The Microprocessor-En Route Automated Radar
  Tracking System (MEARTS) is a radar processing system implemented with commercial
  off-the-shelf (COTS) equipment, for use in the Anchorage, Alaska Air Route Traffic
  Control Center (ARTCC) and Center Radar Approach Control (CERAPs) environments.
  \ It provides single sensor and a mosaic display of traffic and weather using long-
  and short-range radars and at Anchorage it processes and displays Automatic Dependent
  Surveillance-Broadcast (ADS-B) surveillance as well.  The MEARTS interfaces with
  multiple types of displays, including the flat panel Display System Replacement
  (DSR)(modified).\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
